import React from 'react';
import Compare from './Compare.'; // Make sure to provide the correct path

const Home = (props) => {
  const { showAlter } = props;

  // Define a function to handle the comparison result
  const handleCompare = (comparisonData) => {
    // You can perform actions with the comparisonData here
    // For example, you might want to show an alert:
    alert(`Comparing ${comparisonData.start} to ${comparisonData.end}`);
  };

  return (
    <div>
      <h1>Welcome to the Home Page</h1>
      <Compare onCompare={handleCompare} />
      {/* Pass the handleCompare function as a prop to Compare */}
    </div>
  );
};

export default Home;
